import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Navigation from './components/layout';

// Import other components as needed

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Navigation />
          {/* Your routes here */}
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
